import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <iframe style="border: 1px solid rgba(0, 0, 0, 0.1);" width="800" height="450" src="https://www.figma.com/embed?embed_host=share&url=https%3A%2F%2Fwww.figma.com%2Fproto%2FZuFMXy59HMtn5mEywPuf2o%2FWireframe-barney%3Fpage-id%3D181%253A166%26node-id%3D213%253A160036%26viewport%3D241%252C48%252C0.81%26scaling%3Dmin-zoom%26starting-point-node-id%3D223%253A15214" allowfullscreen></iframe>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
